	self.toType = function(obj) {
		if (obj === null) {
			return 'null';
		} else if (typeof obj == 'undefined') {
			return 'undefined';
		} else {
			return {}.toString.call(obj).match(/\s([a-z|A-Z]+)/)[1].toLowerCase();
		}
	};
